import axios from "axios";

export function configList() {
  return new Promise((resolve) => {
    axios
      .get(window._init_url, {})
      .then(
        (response) => {
          resolve(response.data);
        },
        () => {
          resolve({});
        }
      )
      .catch(() => {
        resolve({});
      });
  });
}
